<p>\u907F\u514D\u4F7F\u7528\u591A\u91CD\u6761\u4EF6\u9009\u62E9\u8BED\u53E5\uFF08if else\uFF09\uFF0C\u5145\u5206\u4F53\u73B0\u9762\u5411\u5BF9\u8C61\u8BBE\u8BA1\u601D\u60F3\u3002</p>
