<p>\u770B\u770B BeanDefinitionReader \u63A5\u53E3\u5B9A\u4E49\u7684\u529F\u80FD\u6765\u7406\u89E3\u5B83\u5177\u4F53\u7684\u4F5C\u7528\uFF1A</p>
